The parseClaudeResponse() function in memory-extractor.ts handles multiple response formats from Claude:
1. Direct array: [{ memory objects }]
2. Object wrapper: { memories: [{ memory objects }] }
3. Other wrapper keys: { data: [...], extracted: [...], items: [...] }

Field normalization is applied to all memory objects regardless of wrapper format. The fallback JSON extraction path also applies normalization to ensure consistency.
